import React from "react";
import ReactDom, { render } from 'react-dom';
// multiple render
ReactDom.render([<h1>hello deepak</h1>,<p>how are you</p>,<p>create some awesome websites</p>],document.getElementById('root'));
// jsx = javascript extention 
var h1 = document.createElement('h1');
h1.innerHTML = 'hello deepak saini kya karte ho';
document.getElementById('root').appendChild(h1)
